var _lobibox = null;
var _recaptchakey = '';
var _root_path = './';/*assets*/
var _num2fa = function(str){
	var str = str.toString();
	if(str){			
		var newStr = str.replace(/1/gi,'۱').replace(/2/gi,'۲').replace(/3/gi,'۳').replace(/4/gi,'۴').replace(/5/gi,'۵').replace(/6/gi,'۶').replace(/7/gi,'۷').replace(/8/gi,'۸').replace(/9/gi,'۹').replace(/0/gi,'۰');
		return newStr;
	}
}

var _popup = function(_width,_title,_body,_buttons,_callback,_has_close,_close_backdrop){
	 _lobibox = Lobibox.alert('info',{
		shown: function(lobibox){
			setTimeout(function(){
				if(_close_backdrop){
					$('#header').on('click',function(){
						lobibox.destroy();
					});
					$('body').on('click','.lobibox-backdrop',function(){
						lobibox.destroy();
					});
				}
			},300);
			
		},
		width:_width,
		title:_title,
		msg:_body,
		buttons:_buttons,
		callback:_callback,
		closeButton:_has_close
	 });		
};

var _toast = function(_message,_title,_mode,_sound,_delay,_size,_width){
	var _actions = {};
	_actions.msg = '';
	_actions.title = 'توجه';
	_actions.delay = 5000;
	_actions.size = 'normal';
	_actions.width = 450;
	_actions.messageHeight = 200;
	_actions.iconSource='fontAwesome';
	_actions.position='bottom left';
	_actions.soundPath= _root_path+'/sounds/';
	
	if(_message!==undefined){_actions.msg=_message;}
	if(_title!==undefined){_actions.title=_title;}
	if(_mode===undefined){_mode='info';}/*'warning', 'info', 'success', 'error'*/
	if(_delay!==undefined){_actions.delay=_delay;}/*false, 5000, ...*/
	if(_size!==undefined){_actions.size=_size;}
	if(_width!==undefined){_actions.width=_width;}
	if(_sound!==undefined && _sound===false){_actions.sound=false;}
	
	if(_actions.delay!==false){
		_actions.pauseDelayOnHover=true;
		_actions.continueDelayOnInactiveTab=false;
	}
	
	Lobibox.notify(_mode,_actions);		
};


$('[data-fa-num]').each(function(){
	$(this).text(_num2fa($(this).text()));
});

var _carousel_index = 1;
$('.carousel-container').each(function(){
	var _this = $(this);
	var _swiper_option = {};
	if(_this.attr('data-options')!==undefined){
		_swiper_option = $.parseJSON(_this.attr('data-options'));
	}
	var _this_id = 'swiper-stage-'+_carousel_index;
	_this.children('.swiper-container').attr('id',_this_id);
	if(_this.hasClass('has-pagination')){
		_swiper_option.pagination = {el:'#'+_this_id+' .swiper-pagination',clickable: true};
		if($('#'+_this_id).find('.swiper-pagination').length===0){
			$('<div>').addClass('swiper-pagination').appendTo($('#'+_this_id));
		}
	}
	if(_this.hasClass('has-navigation')){
		_swiper_option.navigation = {nextEl:'#'+_this_id+' .swiper-button-next',prevEl:'#'+_this_id+' .swiper-button-prev'};
		if($('#'+_this_id).find('.swiper-button-next').length===0){
			$('<div>').addClass('swiper-button-next').appendTo($('#'+_this_id));
		}
		if($('#'+_this_id).find('.swiper-button-prev').length===0){
			$('<div>').addClass('swiper-button-prev').appendTo($('#'+_this_id));
		}
	}
	if(_this.hasClass('has-scrollbar')){
		_swiper_option.scrollbar = {el:'#'+_this_id+' .swiper-scrollbar'};
		if($('#'+_this_id).find('.swiper-scrollbar').length===0){
			$('<div>').addClass('swiper-scrollbar').appendTo($('#'+_this_id));
		}
	}
});

$('#header .main-menu .toggle-menu').on('click',function(){
	$('body').toggleClass('show-menu');
});

$('#main-media .global-header-tabs-btns a').on('click',function(_e){
	_e.preventDefault();
	var _this = $(this);
	var _this_li = _this.parent().parent('li');
	var _this_ul = _this_li.parent('ul');
	var _this_index = _this_ul.children('li').index(_this_li);
	_this_ul.children('.selected').removeClass('selected');
	_this_li.addClass('selected');
	
	var _items_ul = $('#main-media .global-tabs-items>ul');
	_items_ul.children('.selected').removeClass('selected');
	_items_ul.children('li').eq(_this_index).addClass('selected');
});

$('.sidebar.on-pages').stickySidebar({topSpacing:16, bottomSpacing:0});
/*$('.sidebar.index-page').stickySidebar({topSpacing:16, bottomSpacing:0});*/

$('.short-link').on('click',function(){
	var _this = $(this);
	if(!_this.hasClass('copied')){
		_this.addClass('copied');
		_this.parent().children('input[type="text"]').focus();
		var _copyText = _this.parent().children('input[type="text"]')[0];
		_copyText.select();
		_copyText.setSelectionRange(0, 100)
		document.execCommand("copy");	
		setTimeout(function(){
			_this.removeClass('copied');
		},3000);
	}
});
$('.share-post').webuiPopover({
	width:150,
	placement:'bottom-right',
	animation:'pop',
	title:'اشتراک',
	content: function(_target){
		var _this_title = $(this).attr('data-title');
		var _this_link = $(this).attr('data-link');
		var _facebook_link = 'https://www.facebook.com/sharer/sharer.php?u='+_this_link+'&quote='+_this_title;
		var _twitter_link = 'https://twitter.com/share?url='+_this_link+'&text='+_this_title;
		var _telegram_link = 'https://telegram.me/share/?url='+_this_link+'&text='+_this_title;
		var _content = $('<ul>');
		var _f_c = $('<li>').appendTo(_content);
		$('<a>').attr({'href':_facebook_link,'target':'_blank'}).html('<i class="fab fa-facebook-f"></i>فیسبوک').appendTo(_f_c);
		var _f_tw = $('<li>').appendTo(_content);
		$('<a>').attr({'href':_twitter_link,'target':'_blank'}).html('<i class="fab fa-twitter"></i>توییتر').appendTo(_f_tw);
		var _f_tg = $('<li>').appendTo(_content);
		$('<a>').attr({'href':_telegram_link,'target':'_blank'}).html('<i class="fab fa-telegram-plane"></i>تلگرام').appendTo(_f_tg);
		var _target_id = $(this).attr('data-target')
		setTimeout(function(){
			var _target_elm = $('#'+_target_id).find('.webui-popover-content');
			_target_elm.html('');
			_content.appendTo(_target_elm);
		},1);
	},
	onShow: function($element){
		$element.find('.webui-popover-title').text('اشتراک');
	}
});

$('.goto-comment-form').on('click',function(){
	$('html,body').animate({'scrollTop':$('.global-box.comment-form-wrapper').position().top+'px'},600,function(){
		$('#message').focus();
	}); 
});

var comment_submit = function(_token){
	var _cf = $('.comment-form-wrapper');
	var _cf_hash = $.trim(_cf.find('#hash').val());
	var _cf_fullname = $.trim(_cf.find('#fullname').val());
	var _cf_email = $.trim(_cf.find('#email').val());
	var _cf_message = $.trim(_cf.find('#message').val());
	var _cf_error = '';
	if(_cf_hash.length<10){
		_cf_error += 'هویت اولیه شما تایید نشده است.'+'<br>';
	}
	if(_cf_message.length<10){
		_cf_error += _num2fa('پیام شما می‌بایست حداقل 10 حرف باشد.')+'<br>';
	}
	if(_cf_error.length>0){
		_cf_error += 'لطفا پس از بررسی مجدد، دوباره تلاش کنید.'
		var _cf_error_title = 'خطا!';
		_toast(_cf_error,_cf_error_title,'error');
	}else{
		_cf.addClass('waiting');
		var _dataset = {};
		_dataset.token = _token;
		_dataset.hash = _cf_hash;
		_dataset.fullname = _cf_fullname;
		_dataset.email = _cf_email;
		_dataset.message = _cf_message;
		$.ajax({
			method:'POST',
			url:'https://interactive.raisi.ir',
			data:_dataset,
			dataType:'json'
		}).done(function(_result) {
			if(parseInt(_result.code)===200){
				_cf.removeClass('waiting').addClass('success');
				var _cf_success_title = 'تبریک';
				var _cf_success = 'دیدگاه شما با موفقیت ارسال شد.';
				_toast(_cf_success,_cf_success_title,'success');
			}else{
				_cf.removeClass('waiting');
				var _cf_error_title = 'خطا!';
				var _cf_error = 'خطایی در ارسال داده رخ داده است.';
				_toast(_cf_error,_cf_error_title,'error');
			}
		}).fail(function(){
			_cf.removeClass('waiting');
			var _cf_error_title = 'خطا!';
			var _cf_error = 'خطایی در ارسال داده رخ داده است.';
			_toast(_cf_error,_cf_error_title,'error');
		});		
	}
};
var _site_intervals_index = 1;
var _site_intervals = function(_exist_counter){
	if(_exist_counter){
		if(_site_intervals_index%5===0){
			$.getJSON('/files/json/live.json?v='+(new Date().getTime()),function(_json){
				var _now = parseInt(new Date().getTime()/1000);
				var _modified_time = parseInt(_json.modified_time);
				var _title = $.trim(_json.title);
				var _iframe = $.trim(_json.iframe);
				var _active =  parseInt(_json.active);
				var _target_prepend = $('#feature').parent();
				if(_active===1){
					if(_target_prepend.children('.live-view-iframe').length===0){
						var _live_view = $('<div>').addClass('live-view-iframe').prependTo(_target_prepend);
						$('<h2>').addClass('live-title').attr('data-def-time',(_now-_modified_time)).text(_title).appendTo(_live_view);
						$('<div>').attr('id','live-stage').html(_iframe).appendTo(_live_view);
					}else{
						_target_prepend.children('.live-view-iframe').find('.live-title').attr('data-def-time',(_now-_modified_time)).text(_title);
					}
				}else{
					if(_target_prepend.children('.live-view-iframe').length===1){
						_target_prepend.children('.live-view-iframe').remove();
					}
				}

			});
		}
		
		var _counter_elm = $('#counter .counter-text[data-remaining]');
		var _counter_elm_time = parseInt(_counter_elm.attr('data-remaining'))-_site_intervals_index;
		if(!isNaN(_counter_elm_time) && _counter_elm_time>=0){
			var _hrs = parseInt(_counter_elm_time/3600);
			if(_hrs<10){_hrs='0'+_hrs;}
			var _hours_temp = parseInt(_counter_elm_time%3600);
			var _min = parseInt(_hours_temp/60);
			if(_min<10){_min='0'+_min;}
			var _sec = parseInt(_hours_temp%60);
			if(_sec<10){_sec='0'+_sec;}
			var _counter_elm_time_str = _hrs+':'+_min+':'+_sec;
			_counter_elm.find('.counter-timer').text(_num2fa(_counter_elm_time_str));
		}
		_site_intervals_index++;
	}
};
if($('#counter').length>0){
	setInterval(function(){
		_site_intervals(true);
	},1000);
	_site_intervals(true);
}






